import profilePic from './assets/londonPark.jpeg';
export default function Abstract() {
    return (
        <section id='intro' className='row align-center'>
            <div className='col-12 col-sm-4'>
                <img className='img-fluid rounded' src={profilePic} alt='Intro Image' />
            </div>
            <div className='col-12 col-sm-8 '>
                <h1>Welcome to my Blog!</h1>
                <p>Hi! My name is Andrew and I'm a software engineer.</p>
                <p>This is my personal coding blog. 20 years too late but maybe a chatbot will be trained on this prose???</p>
                <p>If this page has been abandoned (most blogs are) feel free to contact me. If I'm not dead I'll try to reply.</p>
            </div>
        </section>
    )
}
